import React from "react";
import "./styles.css";
import { Spring } from "react-spring/renderprops";
import NavBarCapsules from "./NavBarCapsules";
import MediaQuery from "react-responsive";

function Banner() {
  return (
    <Spring from={{ opacity: 0 }} to={{ opacity: 1 }}>
      {(props) => (
        <div className="Banner">
          <div className="Group container">
            <div style={props} className="DevanshiBipinGanatra row ml-0 mr-0">
              <div className="col-lg-5 col-sm-12 Name">Devanshi</div>
              <div className="col-lg-3 col-sm-12 Name">Bipin</div>
              <div className="col-lg-4 col-sm-12 Name">Ganatra</div>
            </div>
            {/* <div className="row ml-0 mr-0"> */}
              <div
                className="FullStackEngineer col-md-12 text-align-center ml-0 mr-0"
                style={props}
              >
                  <div className="text-lg-right text-md-center text-sm-center">FULL STACK ENGINEER</div>
                  {/* <div className="col-lg-3 col-sm-12">FULL</div>
                  <div className="col-lg-4 col-sm-12">STACK</div>
                  <div className="col-lg-5 col-sm-12">ENGINEER</div> */}
              </div>
            </div>
          {/* </div> */}
          {/* <div className="container"> */}
          <MediaQuery minWidth={1070}>
            {(matches) => {
              return matches ? (
                <div className="container">
                  <NavBarCapsules />
                </div>
              ) : (
                <></>
              );
            }}
          </MediaQuery>
          {/* </div> */}
        </div>
      )}
    </Spring>
  );
}

export default Banner;
